@pytest.fixture
def clickhouse(clickhouse_url) -> Generator[clickhouse_connect.driver.Client, None, None]:
    params = parse_clickhouse_url(clickhouse_url)
    with clickhouse_connect.create_client(**params) as client:
        yield client


def insert_records(clickhouse: Client, table: str, records: Sequence[dict]):
    columns = records[0].keys()
    data = [[r[col] for col in columns] for r in records]
    clickhouse.insert(table, data, columns)


def test_export_dex_trades(
    clickhouse_migrated,
    clickhouse_adapter_: ClickhouseEthStreamerAdapter,
    dex_trades_sample,
    dex_pools_sample,
    tokens_sample,
    token_transfers_sample,
    internal_transfers_sample,
    transactions_sample,
    logs_sample,
):
    start_block, end_block = 19019719, 19019719
    dex_pools_for_db = deepcopy(dex_pools_sample)
    for pool in dex_pools_for_db:
        pool.pop('type')
    insert_records(
        clickhouse_migrated,
        clickhouse_adapter_.item_type_to_table_mapping[EntityType.DEX_POOL],
        dex_pools_for_db,
    )
    clickhouse_adapter_.eth_streamer.export_blocks_and_transactions = MagicMock(
        return_value=transactions_sample
    )
    clickhouse_adapter_.eth_streamer.export_dex_trades = MagicMock(return_value=dex_trades_sample)
    clickhouse_adapter_.eth_streamer.export_dex_pools = MagicMock(return_value=dex_pools_sample)
    clickhouse_adapter_.eth_streamer.export_tokens = MagicMock(return_value=tokens_sample)
    clickhouse_adapter_.eth_streamer.extract_token_transfers = MagicMock(
        return_value=token_transfers_sample
    )
    clickhouse_adapter_.eth_streamer.extract_internal_transfers = MagicMock(
        return_value=internal_transfers_sample
    )
    clickhouse_adapter_.eth_streamer.export_receipts_and_logs = MagicMock(return_value=logs_sample)
    clickhouse_adapter_.eth_streamer.export_geth_traces = MagicMock(return_value=[])
    clickhouse_adapter_.export_all(start_block, end_block)

    assert clickhouse_adapter_.eth_streamer.export_dex_trades.call_count == 1
    assert clickhouse_adapter_.eth_streamer.export_dex_pools.call_count == 1
    exported_trades = clickhouse_adapter_.select_distinct(
        EntityType.ENRICHED_DEX_TRADE, start_block, end_block, 'transaction_hash,log_index'
    )
    assert len(exported_trades) == len(dex_trades_sample)
    assert exported_trades[0]['factory_address']
